/* wikiyylex_destroy is for both reentrant and non-reentrant scanners. */
int wikiyylex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		wikiyy_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		wikiyypop_buffer_state();
	}

	/* Destroy the stack itself. */
	wikiyyfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    wikiyyfree ( (yy_state_buf) );
    (yy_state_buf)  = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * wikiyylex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

